        await browser.pause(2000);
        
        })


    it('should click Help button', async () => {
         helpPage.clickHelpButton();
         await browser.pause(2000);
            
        })

    it('is displayed "View documents"?', async () => {
            browseDocs.browseDocsIsDisplayed();
            await browser.pause(2000);
               

        })    


})

